import React, {PureComponent} from 'react'
import './style.css'

class Adding extends PureComponent {
  render() {
    return (
      <div class="form-group">
        <h4>Регистрация:</h4>
        <div><label for="name">Имя</label><input id="name" type="text" placeholder="Имя" class="form-control" /></div>
        <div><label for="surname">Фамилия</label><input id="surname" type="text" placeholder="Фамилия" class="form-control" /></div>
        <div><label for="img">Ава</label><input id="img" type="text" placeholder="Укажите ссылку на аватарку" class="form-control"/></div>
        <button  id="clearButton1" type="button" name="button" class="btn btn-primary">Создать</button>
      </div>
    )
  }
}

export default Adding
